(1, 1, '2016-02-03 04:08:41', '2016-02-03 04:08:41', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', 'Hello world!', '', 'trash', 'open', 'open', '', 'hello-world', '', '', '2016-03-15 19:18:56', '2016-03-15 23:18:56', '', 0, 'http://wp442m.a10-52-158-154.qa.plesk.ru/wordpress/?p=1', 0, 'post', '', 1),
(2, 1, '2016-02-03 04:08:41', '2016-02-03 04:08:41', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://wp442m.a10-52-158-154.qa.plesk.ru/wordpress/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'trash', 'closed', 'open', '', 'sample-page', '', '', '2016-03-15 19:18:40', '2016-03-15 23:18:40', '', 0, 'http://wp442m.a10-52-158-154.qa.plesk.ru/wordpress/?page_id=2', 0, 'page', '', 0),
(3, 1, '2016-03-15 22:38:24', '0000-00-00 00:00:00', '', 'Auto Draft', '', 'auto-draft', 'open', 'open', '', '', '', '', '2016-03-15 22:38:24', '0000-00-00 00:00:00', '', 0, 'http://winsometech.org/wordpress/?p=3', 0, 'post', '', 0),
(5, 2, '2016-03-12 00:57:50', '2016-03-12 00:57:50', 'Welcome to Winsome Designs! My name is Rhiannon. I make the web a wondrous place for you and me!', 'Hello world!', '', 'trash', 'open', 'open', '', 'hello-world-2', '', '', '2016-03-12 00:57:50', '2016-03-12 00:57:50', '', 0, 'http://localhost:45346/?p=1', 0, 'post', '', 0),
(6, 2, '2016-03-12 00:57:50', '2016-03-12 00:57:50', 'Here at Winsome I believe in creating beautiful design with a purpose. My creative passion only begins here and truly lives in my day-to-day life of constantly fashioning whatever I can to solve problems and bring more fun into everyday. I work with all kinds of languages, version control and content management systems; the best tools a pro could use to make a web masterpiece.\r\n\r\nWould you like to make something fantastic? Contact me at rhiannon at winsometech dot org', 'Hello there!  I''m Rhiannon & I love making websites', '', 'publish', 'closed', 'open', '', 'home-page', '', '', '2016-03-15 20:00:57', '2016-03-16 00:00:57', '', 0, 'http://localhost:45346/?page_id=2', 1, 'page', '', 0),
(7, 2, '2016-03-12 01:08:51', '2016-03-12 01:08:51', '', 'Portfolio', '', 'publish', 'closed', 'closed', '', 'portfolio-2', '', '', '2016-03-12 01:08:51', '2016-03-12 01:08:51', '', 0, 'http://localhost:45346/?page_id=6', 2, 'page', '', 0),
(19, 2, '2016-03-11 21:00:20', '2016-03-12 02:00:20', '', 'Portfolio', '', 'trash', 'closed', 'closed', '', 'portfolio', '', '', '2016-03-11 21:00:20', '2016-03-12 02:00:20', '', 0, 'http://localhost:45346/?page_id=19', 2, 'page', '', 0),
(24, 2, '2016-03-11 21:12:17', '2016-03-12 02:12:17', 'Let me know if you like the site and want to work together. In case you were looking for more examples of my work stay tuned! I''m currently creating a new website that will be unveiled shortly. :-)', 'New Projects', '', 'publish', 'open', 'open', '', 'new-projects', '', '', '2016-03-11 21:12:17', '2016-03-12 02:12:17', '', 0, 'http://localhost:45346/?p=24', 0, 'post', '', 0),
(25, 1, '2016-03-15 23:16:43', '2016-03-15 23:16:43', '', 'Vintage sketch background with orange birds', 'Seamless vector pattern with ink hand drawn birds on blooming tree twigs.', 'inherit', 'open', 'closed', '', 'vintage-sketch-background-with-orange-birds', '', '', '2016-03-15 23:16:43', '2016-03-15 23:16:43', '', 0, 'http://winsometech.org/wordpress/wp-content/uploads/2016/03/bird_pattern_1.jpg', 0, 'attachment', 'image/jpeg', 0),
